import Navbar from './Navbar';
import {useEffect, useState} from 'react';


const Home = () => {

    const [users, setUser] = useState(null)

    useEffect(()=>  {
    const fetchUser = async () =>{
        const response = await fetch('http://localhost:8080/api/test/642dd375c85d7c6018d021e9')
        const json = await response.json()
        if(response.ok){
                setUser(json)
        }
    }
    fetchUser()
}, [])


    return (
        <div><div className='user'>

                {users && <p key={users._id}>{users.name}</p>}
          
            </div>
            <Navbar/>
            <h1>
                Home!
            </h1>
        </div>
    );
}

export default Home;
